import Login from './pages/Login';
import Signup from './pages/Signup';
import './App.css';
import { Route, Routes, Link } from 'react-router-dom';

function App() {
  return (
    <div className='App'>
      <header className='App-header'>
      <Routes>
        <Route path='/' element={<Login />}/>
      </Routes>
      </header>
    </div>
  );
}

export default App;
